import spazio from '../img/post-bg.jpg';
import spazio1 from '../img/post-sample-image.jpg';
import Navbar from '../components/navbar';
import Header1 from '../components/HeaderArticolo';

class Articolo extends React.Component {
    state = {
        articolo:[ {id:0, immagine:'', titolo:'', sottotitolo:'', autore:''},
    
        ]
};


    render(){
        return(
            <div>
                <title>Blog di Calasanzio Alessandro</title>
            <Navbar/>
            {state.map(articolo=>(
                <Header1 key={articolo.id}/>
            ))}



            </div>
        )
    }
}

export default Articolo;
